import React from "react";
import CustomNavbar from "./Header";
import "../Styles/home.css";
import{
  Card,
  CardBody,
  CardText,
} from 'reactstrap'

function Home() {
  return (
    <>
      <CustomNavbar />
      <div className="hcard">

        
         <p className="title"> Table Question <br/> 
          Answering Model </p>


        <Card
          style={{
            width: "18rem",
          }}
        >
          <CardBody>
            <CardText>
              Some quick example text to build on the card title and make up the
              bulk of the cardâ€˜s content.
            </CardText>
          </CardBody>
        </Card>
      </div>
    </>
  );
}

export default Home;
